import React from 'react';
import './App.css';
import {Board} from "./Board";

function App() {
  return (
    <div className="App">
      <header className="App-header">
          <div className = "game">
            <Board letters={[["A", "B", "C"], ["w2", "w3", "D"], ["E", "l1", "l2"]]}/>
          </div>
      </header>
    </div>
  );
}

export default App;
